import React, { useState } from 'react';
import './App.css';

function App() {
  const [submitting, setSubmitting] = useState(false);
  const handleSubmit = event => {
    event.preventDefault();
   setSubmitting(true);

   console.log(event.target.amount);

   setTimeout(() => {
     setSubmitting(false);
   }, 3000)
 }

  return(
    <div className="wrapper">
      <h1>Lorum Ipsem Lorum Ipsem Lorum Ipsem</h1>
      {submitting &&
       <div>Submtting Form...</div>
     }

      <form onSubmit={handleSubmit}>
        <fieldset><label>

            <div class="myself"><br/>

            <div class="property">Investment Amount:</div>
            <div class="value"><input type="number" name="amount" min="0.01"/></div><br/><br/>

            <div class="property">Investment Type:</div>
            <div class="value"><input type="text" name="type"/></div><br/><br/>

            <div class="property">Total Net Worth </div>
            <div class="value"><input type="number" name="worth" min="0.01" /></div><br/><br/>

            <div class="property">User Estimated Yearly Income </div>
            <div class="value"><input type="number" name="income" min="0.01"/></div><br/><br/>

            <div class="property">User Estimated Credit Score </div>
            <div class="value"><input type="number" name="credit" min="300" max="850"/></div><br/><br/>

            </div>

        </label></fieldset>
        <button type="submit">Submit</button>
      </form>
    </div>
  )
}

export default App;
